source_string:
The version of the app you have selected does not match the suggested version which can lead to unexpected issues. Please use the suggested version.

Selected version: ${selected}
Suggested version: ${suggested}

To continue anyway, disable "Require suggested app version" in the settings.

translation:
Wersja aplikacji, która została wybrana nie jest sugerowana, co może prowadzić do nieoczekiwanych problemów. Proszę wybrać sugerowaną wersję aplikacji.

Wybrana wersja: ${selected}
Sugerowana wersja: ${suggested}

Aby kontynuować, wyłącz "Wymagaj sugerowanej wersji aplikacji" w ustawieniach.

